import React from "react";
import { Link } from "react-router-dom";

function Sidebar() {
  return (
    <nav
      style={{
        width: "200px",
        background: "#f4f4f4",
        padding: "15px",
        height: "100vh",
      }}
    >
      <ul style={{ listStyle: "none", padding: 0 }}>
        <li>
          <Link to="/dashboard">Pairing Dashboard</Link>
        </li>
        <li>
          <Link to="/history">Pairing History</Link>
        </li>
        <li>
          <Link to="/pairing">Pair Students</Link>
        </li>
        <li>
          <Link to="/profile">User Profile</Link>
        </li>
        <li>
          <Link to="/register">Register</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Sidebar;
